import styled from "styled-components";
import React from 'react'

const Header = (props) => {
    return (
        <Container>
            <Content>
                <Logo>
                    <a href="/home" >
                        <img src="/images/home-logo.svg" />
                    </a>
                </Logo>
            </Content>
        </Container>
    );
};

const Container = styled.div`
    

`;
const Content = styled.div`
    display: flex;
    align-items: center;
    margin: 0 auto;
    min-height: 100%;
    max-width: 1128px;
`;

const Logo = styled.span`
    margin: 8px;
    font-size: 0px;
`

export default Header
